INSERT INTO `about` VALUES ('Advanced Institute of  Innovation and Technology Delhi is one of the 4 AIITs created to be Centres of Excellence for training, research and development in science, engineering, innovation and technology in India.\n\nEstablished as College of Engineering in 1958, the Institute was later declared as an Institution of National Importance under the Institutes of Technology (Amendment) Act, 1963 and was renamed as Advanced Institute of  Innovation and Technology.\n It was then accorded the status of a Deemed University with powers to decide its own academic policy, to conduct its own examinations, and to award its own degrees.\n\nSince its inception, over 28000 have graduated from AIIT Delhi in various disciplines including Engineering, Physical Sciences, Management and Humanities & Social Sciences. Of these, nearly 3090 received Ph.D. degrees.\n\n The number of students who graduated with B.Tech. degree is over 10495. The rest obtained Master\'s Degree in Engineering, Sciences and Business Administration. These alumni today work as scientists, technologists, business managers and entrepreneurs. There are several alumni who have moved away from their original disciplines and have taken to administrative services, active politics or are with NGOs. In doing so, they have contributed significantly to building of this nation, and to industrialization around the world.\n\n\n\n\n\n\n\n\n\n\n');
